import React from 'react';
import face from './faces.png';
import styles from './About.css';

class About extends React.Component {
    render() {
        const style1 = {
            color: "red",
        };

        return (
            <div>
                <p className='tc .bg-light-yellow'>About</p>
                <img src={face} className={styles.pic} alt='pic of faces' />
                <p className={styles.sample}>This is a sample paragraph to test the working of the program</p>
            </div>
        );
    }
}

export default About;
